import React, {Component} from 'react';
import {
    BrowserRouter,
    Switch,
    Route,
    Link,
    useParams,
    useRouteMatch
} from "react-router-dom";


class TestFull extends Component {
    constructor(props) {
        super(props);
        this.state = {
            error: null,
            isLoaded: false,
            range: [],
            models: [],

        }
        this.qq=1;


    }
    componentDidMount(){
        let combo=window.location.pathname.split('/');
        this.qq=combo[2]
        const res = fetch("http://127.0.0.1:8000/prizivniki/"+this.qq)
        .then (res => res.json())
        .then(

            (result) =>{
                this.setState({
                    isLoaded:true,
                    range: result,
                });
                // this.range=result;

            },
            (error) =>{
            this.setState({
                isLoaded:false,
                error});
            }
        )
    }
    render() {
        const {error, isLoaded, range} = this.state;
        return (

            <div>
                <div className={"Prizivnik"}>{range.surname}</div>

                <div className={"Prizivnik_list"}>

                {range.map(rang=>(
                    <li key={"modelId:"+rang.pk}>
                        <div className={"model_info"}>

                        <div className={"model_name"}>
                             <Link to={`/range/${this.qq}${rang.pk}/`}>{rang.pk}</Link>
                        </div>
                        <div className={"vozrast"}>Возраст: {rang.vozrast}</div>
                        <div className={"adress"}>Адрес: {rang.adress} руб.</div>

                        </div>
                    </li>
                ))}
                </div>

            </div>
        );
    }
}

export default TestFull;
